import { HttpClient } from '@angular/common/http';
import { Injectable } from '@angular/core';
import { AccountBank } from '../interface/account-bank';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AccountBankService {

  private baseURL = "http://localhost:8080/api/v1/account-banks";
  private baseURL_save = "http://localhost:8080/api/v1/create-account-bank";
  private baseURL_update = "http://localhost:8080/api/v1/update-account-bank";
  private baseURL_delete = "http://localhost:8080/api/v1/delete-account-bank";



  constructor(private httpClient: HttpClient) { }


  getAccountBanksList(): Observable<AccountBank[]>{
    return this.httpClient.get<AccountBank[]>(`${this.baseURL}`);
  }

  createAccountBank(accountBank: AccountBank, id: number): Observable<Object>{
    return this.httpClient.post(`${this.baseURL}/employees/${id}/create-account-bank`, accountBank);
  }

  getAccountBankById(id: number): Observable<AccountBank>{
    return this.httpClient.get<AccountBank>(`${this.baseURL}/${id}`);
  }

  updateAccountBank(id: number, accountBank: AccountBank): Observable<Object>{
    return this.httpClient.put(`${this.baseURL_update}/${id}`, accountBank);
  }
  detailAccountBank(id: number){
    return this.httpClient.get(`${this.baseURL}/${id}`);
  }
  deleteAccountBank(id: number): Observable<Object>{
    return this.httpClient.delete(`${this.baseURL_delete}/${id}`);
  }
}
